CREATE TABLE AKTORE (
    ID NUMBER(4) PRIMARY KEY, 
	IZENA VARCHAR2(45), 
	ABIZENAK VARCHAR2(45)
);

CREATE TABLE HIZKUNTZA (
    ID NUMBER(2) PRIMARY KEY, 
	IZENA VARCHAR2(20)
);

CREATE TABLE KATEGORIA (
    ID NUMBER(2) PRIMARY KEY, 
	IZENA VARCHAR2(25)
);

CREATE TABLE PELIKULA (
    ID NUMBER(5) PRIMARY KEY, 
	IZENBURUA VARCHAR2(255), 
	DESKRIBAPENA CLOB, 
	URTEA VARCHAR2(4), 
	ID_HIZKUNTZA NUMBER(2), 
	ID_JATORRIZKO_HIZKUNTZA NUMBER(2), 
	ALOKAIRU_IRAUPENA NUMBER(1), 
	ALOKAIRU_TARIFA NUMBER(4,2), 
	IRAUPENA NUMBER(3), 
	BERRITZE_KOSTUA NUMBER(5,2), 
	SAILKAPENA VARCHAR2(10), 
	EZAUGARRIAK VARCHAR2(100),
    CONSTRAINT FK_PELIKULA_HIZKUNTZA FOREIGN KEY(ID_HIZKUNTZA) REFERENCES HIZKUNTZA(ID),
    CONSTRAINT FK_PELIKULA_JATORRIZKO_HIZKUNTZA FOREIGN KEY(ID_JATORRIZKO_HIZKUNTZA) REFERENCES HIZKUNTZA(ID)    
);

CREATE TABLE KATEGORIA_PELIKULA (
    ID_PELIKULA NUMBER(5), 
	ID_KATEGORIA NUMBER(2), 
    CONSTRAINT PK_KATEGORIA_PELIKULA PRIMARY KEY (ID_KATEGORIA, ID_PELIKULA),
    CONSTRAINT FK_KATEGORIA_PELIKULA_KATEGORIA FOREIGN KEY(ID_KATEGORIA) REFERENCES KATEGORIA(ID),
    CONSTRAINT FK_KATEGORIA_PELIKULA_PELIKULA FOREIGN KEY(ID_PELIKULA) REFERENCES PELIKULA(ID)
);

CREATE TABLE AKTORE_PELIKULA (
    ID_AKTORE NUMBER(4), 
	ID_PELIKULA NUMBER(5),
    CONSTRAINT PK_AKTOTE_PELIKULA PRIMARY KEY (ID_AKTORE, ID_PELIKULA),
    CONSTRAINT FK_AKTORE_PELIKULA_AKTORE FOREIGN KEY(ID_AKTORE) REFERENCES AKTORE(ID),
    CONSTRAINT FK_AKTORE_PELIKULA_PELIKULA FOREIGN KEY(ID_PELIKULA) REFERENCES PELIKULA(ID)    
);

CREATE TABLE INBENTARIO (
    ID_INBENTARIO NUMBER(8) PRIMARY KEY, 
	ID_PELIKULA NUMBER(5), 
	ID_DENDA NUMBER(1),
    CONSTRAINT FK_INBENTARIO_PELIKULA FOREIGN KEY(ID_PELIKULA) REFERENCES PELIKULA(ID)
);

CREATE TABLE BEZERO (
    ID NUMBER(5) PRIMARY KEY, 
	ID_DENDA NUMBER(1), 
	IZENA VARCHAR2(45), 
	ABIZENAK VARCHAR2(45), 
	EMAILA VARCHAR2(50) DEFAULT NULL, 
	ID_HELBIDE NUMBER(5), 
	AKTIBO CHAR(1) DEFAULT 'B', 
	SORTZE_DATA DATE
); 

CREATE TABLE ALOKAIRU (
    ID NUMBER(9) PRIMARY KEY, 
	ALOKAIRU_DATA DATE, 
	ID_INBENTARIO NUMBER(8), 
	ID_BEZERO NUMBER(5), 
	BUELTATZE_DATA DATE DEFAULT NULL,
    CONSTRAINT FK_ALOKAIRU_INBENTARIO FOREIGN KEY(ID_INBENTARIO) REFERENCES INBENTARIO(ID_INBENTARIO),
    CONSTRAINT FK_ALOKAIRU_BEZERO FOREIGN KEY(ID_BEZERO) REFERENCES BEZERO(ID)
); 


















